class OrdnVerdDAO extends Noark4Base {
	
	public function __construct ($srcBase, $uttrekksBase, $SRC_TABLE_NAME, $logger) {
                parent::__construct (Constants::getXMLFilename('ORDNVERD'), $srcBase, $uttrekksBase, $SRC_TABLE_NAME, $logger);
		$this->selectQuery = "select EKODE, KODETEKST FROM " . $SRC_TABLE_NAME . "";		
	} 
	
	function addOrdnVerdi($ordPrinsipp, $ordVerdi, $ordBeskrivelse) {

		$ordnverd = new OrdnVerd();
		$ordnverd->OV_ORDNPRI = $ordPrinsipp;
		$ordnverd->OV_ORDNVER = $ordVerdi;	
		$ordnverd->OV_BESKR = $ordBeskrivelse;
		// I can accept in most cases REGFLAGG being set to 1, that this value is at the lowest level
		$ordnverd->OV_REGFLAGG = "1";
		// But I don't think SEKFLAGG should be set to 1
		$ordnverd->OV_SEKFLAGG = "1";

		$this->writeToDestination($ordnverd);
	}

	
	function processTable () {

		$this->srcBase->createAndExecuteQuery ($this->selectQuery);
		
		while (($result = $this->srcBase->getQueryResult ($this->selectQuery))) {

			$ordnverd = new OrdnVerd();
			$ordVerdi = $result['EKODE'];	
			$ordnverd->OV_ORDNVER = $result['EKODE'];
			$ordnverd->OV_BESKR = $result['KODETEKST'];

			if(preg_match('/^[0-9]{1,3}$/', $ordVerdi)) {
				$ordnverd->OV_ORDNPRI = "FE";				
	
				if(preg_match('/^[0-9][0-9][0-9]$/', $ordVerdi)) {	
					$ordnverd->OV_REGFLAGG = "1";
					$ordnverd->OV_SEKFLAGG = "1" ;
					$ordnverd->OV_FAR = substr($ordVerdi, 0, 2); 
				}
				else if(preg_match('/^[0-9][0-9]$/', $ordVerdi)) {	
					$ordnverd->OV_REGFLAGG = "0";
					$ordnverd->OV_SEKFLAGG = "1" ;
					$ordnverd->OV_FAR = substr($ordVerdi, 0, 1); 
				}
				else if(preg_match('/^[0-9]$/', $ordVerdi)) {	
					$ordnverd->OV_REGFLAGG = "0";
					$ordnverd->OV_SEKFLAGG = "1" ; 
				}
				else {
					echo "Unable to process " . $ordVerdi . "\n";
				}	

			}
			// If it starts with a &
			else if (preg_match("/^[&][0-9]{0,2}$/", $ordVerdi)) {				
				$ordnverd->OV_ORDNPRI = "TI";
				if(preg_match('/^[&][0-9][0-9]$/', $ordVerdi)) {	
					$ordnverd->OV_REGFLAGG = "1";
					$ordnverd->OV_SEKFLAGG = "1" ;
					$ordnverd->OV_FAR = substr($ordVerdi, 0, 2); 
				}
				else if(preg_match('/^[&][0-9]$/', $ordVerdi)) {	
					$ordnverd->OV_REGFLAGG = "0";
					$ordnverd->OV_SEKFLAGG = "1" ;
					$ordnverd->OV_FAR = substr($ordVerdi, 0, 1); 
				}
				else if(preg_match('/^[&]$/', $ordVerdi)) {	
					$ordnverd->OV_REGFLAGG = "0";
					$ordnverd->OV_SEKFLAGG = "1" ; 
				}
				else {
					echo "Unable to process " . $ordVerdi . "\n";
				}	

				$ordVerdi = str_replace("&", "&amp;", $ordVerdi);
			}
			// IF it starts with a letter
			else if (preg_match("/^[A-Z][0-9]{1,2}$/" , $ordVerdi)) {
				$ordnverd->OV_ORDNPRI = "FA";
				if(preg_match('/^[A-Z][0-9][0-9]$/', $ordVerdi)) {	
					$ordnverd->OV_REGFLAGG = "1";
					$ordnverd->OV_SEKFLAGG = "1" ;
					$ordnverd->OV_FAR = substr($ordVerdi, 0, 2); 
				}
				else if(preg_match('/^[A-Z][0-9]$/', $ordVerdi)) {	
					$ordnverd->OV_REGFLAGG = "0";
					$ordnverd->OV_SEKFLAGG = "1" ;
					$ordnverd->OV_FAR = substr($ordVerdi, 0, 1); 
				}
				else if(preg_match('/^[A-Z]$/', $ordVerdi)) {	
					$ordnverd->OV_REGFLAGG = "0";
					$ordnverd->OV_SEKFLAGG = "1" ; 
				}
				else {
					echo "Unable to process " . $ordVerdi . "\n";
				}	
			}
			else if (preg_match("/^[A-Z]$/" , $ordVerdi)) {
				$ordnverd->OV_ORDNPRI = "FA";
				$ordnverd->OV_REGFLAGG = "0";
				$ordnverd->OV_SEKFLAGG = "0" ;
			}
			else {
				echo "\t\tUnable to handle OV.ORDNVER (" . $ordnverd->OV_ORDNVER . ") with OV_BESKR (" . $ordnverd->OV_BESKR . ")\n";	
			}

			$this->writeToDestination($ordnverd);
		}		
		$this->srcBase->endQuery($this->selectQuery);
	}
	
	function writeToDestination($data) {
		
		$sqlInsertStatement = "INSERT INTO ORDNVERD (OV_ORDNPRI, OV_FAR, OV_ORDNVER, OV_BESKR, OV_REGFLAGG, OV_SEKFLAGG) VALUES (";
	
		$sqlInsertStatement .= "'" . $data->OV_ORDNPRI . "', ";			
		$sqlInsertStatement .= "'" . $data->OV_FAR . "', ";			
		$sqlInsertStatement .= "'" . $data->OV_ORDNVER . "', ";			
		$sqlInsertStatement .= "'" . $data->OV_BESKR . "', ";			
		$sqlInsertStatement .= "'" . $data->OV_REGFLAGG . "', ";			
		$sqlInsertStatement .= "'" . $data->OV_SEKFLAGG . "' ";			
	
		$sqlInsertStatement.= ");";
		
		$this->uttrekksBase->executeStatement($sqlInsertStatement);
    }

   function createXML($extractor) {    
    	$sqlQuery = "SELECT * FROM ORDNVERD";
    	$mapping = array ('idColumn' => 'ov_ordnpri', 
  				'rootTag' => 'ORDNVERDI.TAB',	
			    		'rowTag' => 'ORDNVERDI',
  						'encoder' => 'utf8_decode',
  						'elements' => array(
							'OV.ORDNPRI' => 'ov_ordnpri',
							'OV.ORDNVER' => 'ov_ordnver',
							'OV.FAR' => 'ov_far',
							'OV.BESKR' => 'ov_beskr',
							'OV.REGFLAGG' => 'ov_regflagg',
							'OV.SEKFLAGG' => 'ov_sekflagg'
  							) 
						) ;
		
    	$extractor->extract($sqlQuery, $mapping, $this->XMLfilename, "file");
    	
    } 
    
    
    
